<template>
  <a-card class="app-card" hoverable @click="emit('click')">
    <template #cover>
      <div class="cover-wrapper">
        <img class="app-cover" :src="app.cover || DEFAULT_COVER" alt="cover" @error="handleImgError" />
      </div>
    </template>

    <a-card-meta>
      <template #description>
        <div class="desc">
          <div class="meta-row">
            <UserOutlined class="icon" />
            <span class="text-ellipsis">{{ app.user?.userName ?? '未知' }}</span>
          </div>
          <div class="meta-row">
            <AppstoreOutlined class="icon" />
            <span class="text-ellipsis">{{ app.codeGenType ?? '-' }}</span>
          </div>
        </div>
        <div class="app-card-title" :title="app.appName || '未命名应用'">
          {{ app.appName || '未命名应用' }}
        </div>
      </template>
    </a-card-meta>

    <template #actions>
      <a-tooltip title="对话">
        <MessageOutlined key="chat" @click.stop="emit('openChat')" />
      </a-tooltip>
      <a-tooltip title="编辑">
        <EditOutlined key="edit" @click.stop="emit('edit')" />
      </a-tooltip>
      <a-tooltip title="删除" v-if="showDelete">
        <DeleteOutlined key="delete" @click.stop="emit('delete')" class="delete-icon" />
      </a-tooltip>
    </template>
  </a-card>
</template>

<script setup lang="ts">
import {
  UserOutlined,
  AppstoreOutlined,
  MessageOutlined,
  EditOutlined,
  DeleteOutlined,
} from '@ant-design/icons-vue'

const props = defineProps<{
  app: API.AppVO
  showDelete?: boolean
}>()

const emit = defineEmits<{
  (e: 'click'): void
  (e: 'openChat'): void
  (e: 'edit'): void
  (e: 'delete'): void
}>()

// 默认封面图
const DEFAULT_COVER = 'data:image/webp;base64,'

// 图片加载失败时回退到默认图
const handleImgError = (e: Event) => {
  const img = e.target as HTMLImageElement
  if (img.src !== DEFAULT_COVER) {
    img.src = DEFAULT_COVER
  }
}
</script>

